  render() {
    return (
      <div>
        <Modal trigger={<Button>Show Modal</Button>}>
          <Modal.Header>Select a Photo</Modal.Header>
          <Modal.Content image>
            <Card float='left' size='small'>
            </Card>
            <Modal.Description>
              <Header>LEAD DETAILS</Header>

            </Modal.Description>
          </Modal.Content>
        </Modal>
      </div>
    );
  }
}
